Table 2 presents the computed rate of heat transfer (Nusselt number,
N u
) with respect to fractional order, time, and volume fraction parameters. The table indicates both increasing and decreasing trends for different parameters. The Nusselt number decreases with increasing fractional order and time, while it increases as the volume fraction increases. The fractional order is associated with the memory effect and non-local behavior in the system. As the fractional order increases, the system exhibits stronger memory, meaning the current state depends more on its past behavior. This tends to slow down the transfer of heat, reducing the Nusselt number. Similarly, for the time parameter, heat transfer often decreases over time in transient systems as they approach thermal equilibrium. The volume fraction represents the concentration of nanoparticles in the fluid. When the volume fraction increases, more nanoparticles are suspended in the base fluid, which enhances its thermal conductivity. This leads to an increased rate of heat transfer, reflected in a higher Nusselt number. This trend is particularly important in applications where improving heat dissipation is crucial, such as in cooling systems and energy storage. These behaviors highlight the balance between thermal enhancement (via nanoparticles) and the complexity introduced by non-local effects in fractional systems.
